import views from "./components/views";

const HOME = {
    component: views.Home,
    path: "/",
    isPrivate: false
}

const LOGIN = {
    component: views.Home,
    path: "/login"
}

const CONTACTUS = {
    component: views.Home,
    path: "/contact-us"
}

export default [HOME, LOGIN, CONTACTUS];
